import React  from "react";
import QRCode from "qrcode.react";

export default function WalletVisualizer(props) {
  const renderQR = wallet => {
    if (wallet && wallet.address && !!wallet.address.length) {
      return <QRCode value={wallet.address} />;
    } else {
      return <div />;
    }
  };
  let wallet = { ...props.wallet };

  let image 
  if(props.image.includes('PaperWalletBase')) {
    image = base(props.color)
  } else {
    image = (<img src={props.image} alt="" style={{borderRadius:'20px',fill:props.color}} className="" /> )
  }


  return (
    <div className="image " >
      {image}
      <p className={"text-over-address is-size-4 " + (props.darkText?"has-text-dark":"has-text-light")}>
        <strong>
          {wallet.address || ""}
        </strong>
      </p>
      <p className={"text-over-passphrase is-size-4 " + (props.darkText?"has-text-dark":"has-text-light")}>
        <strong>
          {wallet.passphrase || ""}
        </strong>
      </p>
      <p className={"text-over-message is-size-4 " + (props.darkText?"has-text-dark":"has-text-light")}>
        <strong>
          {props.message || ""}
        </strong>
      </p>
      <span className="qr-code">
          {renderQR(wallet)}
        </span>
    </div>
  );
}

